export const getStaticImageUrls = (categoryName) => {
    //let assestsUrl = "https://www.medplusmart.com/"
    let assestsUrl = process.env.ASSETS_URL;
    switch(categoryName){
        case "Pharmacy": return `${assestsUrl}images/common/pharmacy-cat-icn.png`
        case "Diagnostics": return `${assestsUrl}images/common/lab-tests-cat-icn.png`
        case "Doctors": return `${assestsUrl}images/common/doctors-cat-icn.png`
        case "MedPlus Advantage": return `${assestsUrl}images/common/medplus-advantage-cat-icn.svg`
        default : return undefined;
    }
}

